webpackJsonp([0x762ce93d9dcf],{754:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Solar Sailer",author:"Matthieu Oger"}},markdownRemark:{html:'<p><img src="/images/posts/2014-04-04-monument-valley.png" alt="Monument Valley"></p>\n<p>A wonderful new game (available on iOS and soon on Android). It reminds me of <a href="http://fezgame.com/">Fez</a>, <a href="http://thatgamecompany.com/games/journey/">Journey</a> and <a href="http://www.swordandsworcery.com/">Sworcery</a>, but still with its own unique atmosphere and mechanics.</p>\n<p>The game is short, reasonably priced (4$) and stunning. Sounds are just perfect.</p>\n<p>I\'m pretty sure that this game is going to generalize <a href="http://imgur.com/a/knj1I#8">low-poly graphics</a> in indie games.</p>\n<p>â†’ <a href="http://monumentvalleygame.com/">More info here</a>.</p>',frontmatter:{date:"2014-04-04",readableDate:"04 April 2014",title:"Monument Valley",showPageTitle:null},fields:{path:"/2014/04/monument-valley/"}}},pathContext:{id:"/Users/ashen/Code/solarsailer.net/content/posts/2014-04-04-monument-valley.md absPath of file >>> MarkdownRemark"}}}});
